    <div>
      <h1>{CurrentCountry.name}</h1>
      capital {CurrentCountry.capital}
      population {CurrentCountry.population}
      <h2>
        <ul>
          {CurrentCountry.languages.map((language) => (
            <li>{language}</li>
          ))}
        </ul>
      </h2>
      <img>{CurrentCountry.flag}</img>
    </div>
  );
};
export default Country;
